import React from 'react'

const Feedback = ({funcaoOk, funcaoNOk, textoOk, textoNOk}) => {
    return (
        <div className='d-flex jistify-content-evenly m-2'>
            {/* button[type=button].btn.btn- *2 
                Cria dois bot√µes iguais, com as classes
            */}
