                type="button" 
                className="btn btn-primary"
                onClick={funcaoOk}>
                {textoOk}
            </button>
            <button 
                type="button" 
                className="btn btn-danger"
                onClick={funcaoNOk}>
                {textoNOk}
            </button>
        </div>
    )
}

export default Feedback
